import React, {useState} from 'react';
import { Grid, Image, List } from 'semantic-ui-react'

const _SearchMovieListDisplay = (props) => {

    return (
        <React.Fragment>
            {props.movieDetails.count > 0 ? 
            <List bulleted horizontal padded>
                <center className="customImageDisplay">
                    <Image onClick={() => alert(props.movieDetails)} src={props.movieImage} className="sizeOfNewSearchMovie" />
                </center>
            </List> : 
            <List>
                No Results to Display..
            </List>
}
        </React.Fragment >
    )
}

export default _SearchMovieListDisplay;
